import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Find the search input and type 'iPhone'
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_text_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_text_entered.png'));

    // 2. Find and click the search button
    await page.waitForSelector('button.search-btn', { timeout: 5000 });
    // There are multiple search buttons, we click the first one associated with the input
    await page.locator('button.search-btn').first().click();

    // Wait for the search results to be displayed (JS updates the DOM)
    await page.waitForSelector('.search-results h2', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // 3. Extract the search result header text to verify
    const searchResultHeader = await page.textContent('.search-results h2');

    return {
      success: true,
      action: "Searched for 'iPhone' and verified the results header.",
      extractedData: {
        searchResultHeader: searchResultHeader
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to search for products",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
